import React, { useState, useEffect } from 'react';
import { usersAPI, swapsAPI } from '../services/api';

const Browse = () => {
  const [users, setUsers] = useState([]);
  const [searchTerm, setSearchTerm] = useState('');
  const [location, setLocation] = useState('');
  const [loading, setLoading] = useState(false);
  const [selectedUser, setSelectedUser] = useState(null);
  const [swapRequest, setSwapRequest] = useState({
    skill_offered: '',
    skill_requested: '',
    message: ''
  });

  useEffect(() => {
    fetchUsers();
  }, []);

  const fetchUsers = async () => {
    setLoading(true);
    try {
      const response = await usersAPI.searchUsers({ skill: searchTerm, location });
      setUsers(response.data);
    } catch (error) {
      console.error('Error fetching users:', error);
    }
    setLoading(false);
  };

  const handleSearch = (e) => {
    e.preventDefault();
    fetchUsers();
  };

  const sendSwapRequest = async (e) => {
    e.preventDefault();
    try {
      await swapsAPI.sendSwapRequest({
        receiver_id: selectedUser.id,
        ...swapRequest
      });
      alert('Swap request sent successfully!');
      setSelectedUser(null);
      setSwapRequest({ skill_offered: '', skill_requested: '', message: '' });
    } catch (error) {
      alert('Error sending swap request');
    }
  };

  return (
    <div className="min-h-screen px-4 py-8">
      <div className="max-w-7xl mx-auto">
        <div className="text-center mb-12 animate-fadeInUp">
          <h1 className="text-4xl font-bold font-poppins bg-gradient-to-r from-blue-400 via-purple-500 to-teal-400 bg-clip-text text-transparent mb-4">
            Discover Amazing Skills
          </h1>
          <p className="text-slate-400 text-lg font-inter">Connect with talented people and exchange knowledge</p>
        </div>

        {/* Search Form */}
        <form onSubmit={handleSearch} className="glass-card rounded-3xl p-6 mb-8 animate-fadeInUp">
          <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
            <div>
              <label className="block text-slate-300 text-sm font-medium mb-2 font-inter">Search Skills</label>
              <input
                type="text"
                value={searchTerm}
                onChange={(e) => setSearchTerm(e.target.value)}
                placeholder="e.g., JavaScript, Guitar, Cooking"
                className="input-glass w-full px-4 py-3 rounded-2xl focus:ring-2 focus:ring-blue-500/50 transition-all duration-300"
              />
            </div>
            <div>
              <label className="block text-slate-300 text-sm font-medium mb-2 font-inter">Location</label>
              <input
                type="text"
                value={location}
                onChange={(e) => setLocation(e.target.value)}
                placeholder="e.g., New York, Remote"
                className="input-glass w-full px-4 py-3 rounded-2xl focus:ring-2 focus:ring-blue-500/50 transition-all duration-300"
              />
            </div>
            <div className="flex items-end">
              <button
                type="submit"
                className="btn-primary w-full py-3 px-6 rounded-2xl font-medium font-inter"
              >
                üîç Search
              </button>
            </div>
          </div>
        </form>

        {/* Users Grid */}
        {loading ? (
          <div className="text-center py-16">
            <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-blue-400 mx-auto mb-4"></div>
            <p className="text-slate-400 font-inter">Finding amazing people...</p>
          </div>
        ) : (
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
            {users.map((user, index) => (
              <div key={user.id} className="glass-card rounded-3xl p-6 animate-fadeInUp" style={{animationDelay: `${index * 0.1}s`}}>
                <div className="flex items-center mb-4">
                  <div className="avatar w-16 h-16 rounded-full text-xl font-bold">
                    {user.name.charAt(0).toUpperCase()}
                  </div>
                  <div className="ml-4">
                    <h3 className="font-semibold text-white text-lg font-poppins">{user.name}</h3>
                    <p className="text-slate-400 text-sm font-inter flex items-center">
                      üìç {user.location || 'Location not set'}
                    </p>
                  </div>
                </div>

                <div className="mb-4">
                  <p className="text-slate-300 text-sm mb-3 font-inter font-medium">Skills:</p>
                  <div className="flex flex-wrap gap-2">
                    {user.skills && user.skills.slice(0, 4).map((skill, index) => (
                      <span key={index} className="skill-tag px-3 py-1 rounded-full text-xs">
                        {skill}
                      </span>
                    ))}
                    {user.skills && user.skills.length > 4 && (
                      <span className="skill-tag px-3 py-1 rounded-full text-xs opacity-70">
                        +{user.skills.length - 4} more
                      </span>
                    )}
                  </div>
                </div>

                <div className="mb-6">
                  <p className="text-slate-400 text-sm font-inter">
                    üïí Available: {user.availability || 'Flexible'}
                  </p>
                </div>

                <button
                  onClick={() => setSelectedUser(user)}
                  className="btn-primary w-full py-3 px-6 rounded-2xl font-medium font-inter"
                >
                  ‚ú® Request Swap
                </button>
              </div>
            ))}
          </div>
        )}

        {users.length === 0 && !loading && (
          <div className="text-center py-16">
            <div className="text-6xl mb-4">üîç</div>
            <h3 className="text-xl font-semibold text-slate-300 mb-2 font-poppins">No users found</h3>
            <p className="text-slate-400 font-inter">Try adjusting your search criteria</p>
          </div>
        )}

        {/* Swap Request Modal */}
        {selectedUser && (
          <div className="fixed inset-0 bg-black/50 backdrop-blur-sm flex items-center justify-center p-4 z-50">
            <div className="glass-card rounded-3xl p-8 max-w-md w-full animate-fadeInUp">
              <div className="text-center mb-6">
                <div className="avatar w-16 h-16 rounded-full text-xl font-bold mx-auto mb-4">
                  {selectedUser.name.charAt(0).toUpperCase()}
                </div>
                <h3 className="text-xl font-bold text-white font-poppins mb-2">
                  Request Skill Swap
                </h3>
                <p className="text-slate-400 font-inter">with {selectedUser.name}</p>
              </div>

              <form onSubmit={sendSwapRequest} className="space-y-4">
                <div>
                  <label className="block text-slate-300 text-sm font-medium mb-2 font-inter">Skill You're Offering</label>
                  <input
                    type="text"
                    value={swapRequest.skill_offered}
                    onChange={(e) => setSwapRequest({...swapRequest, skill_offered: e.target.value})}
                    className="input-glass w-full px-4 py-3 rounded-2xl focus:ring-2 focus:ring-blue-500/50 transition-all duration-300"
                    placeholder="What can you teach?"
                    required
                  />
                </div>

                <div>
                  <label className="block text-slate-300 text-sm font-medium mb-2 font-inter">Skill You Want</label>
                  <input
                    type="text"
                    value={swapRequest.skill_requested}
                    onChange={(e) => setSwapRequest({...swapRequest, skill_requested: e.target.value})}
                    className="input-glass w-full px-4 py-3 rounded-2xl focus:ring-2 focus:ring-blue-500/50 transition-all duration-300"
                    placeholder="What do you want to learn?"
                    required
                  />
                </div>

                <div>
                  <label className="block text-slate-300 text-sm font-medium mb-2 font-inter">Message</label>
                  <textarea
                    value={swapRequest.message}
                    onChange={(e) => setSwapRequest({...swapRequest, message: e.target.value})}
                    className="input-glass w-full px-4 py-3 rounded-2xl focus:ring-2 focus:ring-blue-500/50 transition-all duration-300 resize-none"
                    rows="3"
                    placeholder="Tell them why you'd like to swap skills..."
                  />
                </div>

                <div className="flex gap-3 pt-4">
                  <button
                    type="button"
                    onClick={() => setSelectedUser(null)}
                    className="btn-secondary flex-1 py-3 px-6 rounded-2xl font-medium font-inter"
                  >
                    Cancel
                  </button>
                  <button
                    type="submit"
                    className="btn-primary flex-1 py-3 px-6 rounded-2xl font-medium font-inter"
                  >
                    Send Request
                  </button>
                </div>
              </form>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default Browse;
